import React, { Component } from 'react';
import Counters from './components/counters';
import Navbar from './components/navbar';

class App extends Component {
  render() {
    return (
     <React.Fragment>
        <Navbar/>
          <main className="container">
       <Counters/>
       </main>
     </React.Fragment>
    );
  }
}
export default App;
